export const Contact=()=> {
    var container = document.createElement('div');
    container.className = 'container';

    var left = document.createElement('div');
    left.className = 'left';

    var formWrapper = document.createElement('div');
    formWrapper.className = 'form-wrapper';

    var contactHeading = document.createElement('div');
    contactHeading.className = 'contact-heading';

    var heading = document.createElement('h1');
    heading.innerHTML = "Let's work together<span>.</span>";
    contactHeading.appendChild(heading);

    var text = document.createElement('p');
    text.className = 'text';
    text.innerHTML = 'Or reach us via : <a href="mailto:owenbolling2@gmail.com">owenbolling2@gmail.com</a>';
    contactHeading.appendChild(text);

    var form = document.createElement('form');
    form.action = 'index.html';
    form.method = 'post';
    form.className = 'contact-form';

    var inputWrap = document.createElement('div');
    inputWrap.className = 'input-wrap';

    var input = document.createElement('input');
    input.type = 'text';
    input.name = 'First Name';
    input.className = 'contact-input';
    input.autocomplete = 'off';
    input.required = true;

    var label = document.createElement('label');
    label.innerHTML = 'First Name';

    // Assuming Ion icons are loaded elsewhere
    var icon = document.createElement('i');
    icon.innerHTML = '<ion-icon name="airplane-outline"></ion-icon>';

    inputWrap.appendChild(input);
    inputWrap.appendChild(label);
    inputWrap.appendChild(icon);
    form.appendChild(inputWrap);
    formWrapper.appendChild(contactHeading);
    formWrapper.appendChild(form);
    left.appendChild(formWrapper);
    container.appendChild(left);

    var right = document.createElement('div');
    right.className = 'right';
    container.appendChild(right);

    var section = document.createElement('section');
    section.className = 'contact';
    section.appendChild(container);

    return section;
}
